import React from 'react';
import { StringLiteralLike } from 'typescript';

interface tourType {
    name: string;
    location: string;
    email: string;
}

export function TouristDet(props:tourType){
    return <div>
        {props.name}
        {props.location}
        {props.email}
    </div>
};
